package com.example.homeaccommodationtravel.utils;

import java.io.File;
import java.io.FileOutputStream;
import java.io.OutputStream;
import java.net.URLDecoder;
import java.text.SimpleDateFormat;
import java.util.Base64;
import java.util.Date;
import java.util.UUID;

public class Base64Util {

    ///先将base64转成字节数在
    public static String base64ToByte(String imageBase64) {
        byte[] b = null;
        Base64.Decoder decoder = Base64.getDecoder();
        try {
            if (imageBase64.indexOf("data:image/jpeg;base64,") != -1) {
                b = decoder.decode(imageBase64.replaceAll("data:image/jpeg;base64,", ""));
            } else {
                if (imageBase64.indexOf("data:image/png;base64,") != -1) {
                    b = decoder.decode(imageBase64.replaceAll("data:image/png;base64,", ""));
                } else {
                    b = decoder.decode(imageBase64.replaceAll("data:image/jpg;base64,", ""));
                }
            }
            for (int i = 0; i < b.length; ++i) {
                if (b[i] < 0) {// 调整异常数据
                    b[i] += 256;
                }
            }
        } catch (Exception e) {
            e.printStackTrace();
        }
        return filePath(b);
    }

    /**
     * {@code 功能描述: 将二进制转换为图片
     *
     * @param b        二进制
     * @param userName 用户名
     * @author hzj
     * @since 2019-7-23 17:53:21
     * @return 图片路径 如果是null 就是保存失败
     */
    public static String filePath( byte[] b) {
        String imgPath = null;   //最终返回的图片路径
        try {
            //为了避免重复，图片名字改成 用户名+当前时间+图片格式
            SimpleDateFormat sdf = new SimpleDateFormat("yyyyMMddHHmmss");
            String fileAdd = sdf.format(new Date()); //当前时间
            //图片存储路径
            //如果要存到当前项目路径下就用这个
            //String resourcesPath = new UploaderUtil().getClass().getResource("/").getPath();
            // 自定义路径
            String resourcesPath1 = "D:\\project\\vueProject\\home_accommodation_travel_admin\\src\\imgs\\";
            String resourcesPath2 = "D:\\project\\vueProject\\home_accommodation_travel_user\\src\\imgs\\";
            //做转码,否则存的图片名字会乱码
            resourcesPath1 = URLDecoder.decode(resourcesPath1, "UTF-8");
            resourcesPath2 = URLDecoder.decode(resourcesPath2, "UTF-8");
            //图片名称是  当前日期 + 随机数   避免数据重复
            String fileName = fileAdd + UUID.randomUUID().toString().replaceAll("-","") + ".jpeg";
            //用于写入的图片路径
            String Path1 = resourcesPath1 + fileName;
            String Path2 = resourcesPath2 + fileName;
            //如果自定义路径,首先判断路径是否存在
            File directory1 = new File(resourcesPath1);
            File directory2 = new File(resourcesPath2);
            if(!directory1.exists()){
                directory1.mkdir();
            }
            if(!directory2.exists()){
                directory2.mkdir();
            }
            //如果文件夹不存在则创建
            File file1 = new File(Path1);
            if (!file1.exists()) {
                file1.createNewFile();
            }
            File file2 = new File(Path2);
            if (!file2.exists()) {
                file2.createNewFile();
            }
            //将二进制在转换为图片
            OutputStream out1 = new FileOutputStream(Path1);
            OutputStream out2 = new FileOutputStream(Path2);
            out1.write(b);
            out1.flush();
            out1.close();

            out2.write(b);
            out2.flush();
            out2.close();
            imgPath = fileName;
        } catch (Exception e) {
            imgPath = null;
            e.printStackTrace();
        }
        return imgPath;
    }

    public static void main(String[] args) {
        StringBuilder sb = new StringBuilder();
        sb.append("data:image/jpg;base64,");
        sb.append("");
        sb.append("");
        String s = Base64Util.base64ToByte(sb.toString());
        if(s != null) System.out.println(s);
    }
}
